import React from 'react';

function Products() {
  return (
    <div>
      <h1>Our Products</h1>
      <ul>
        <li>Mesh Doors</li>
        <li>Mosquito Nets</li>
        <li>Window Blinds</li>
        <li>Custom Home Decor Solutions</li>
      </ul>
    </div>
  );
}

export default Products;
